//设置浏览器cookie
function set_cookie(key, value, expire, path) {
  var keys = 'KT-' + key;
  path = path || '/';
  // var C_DOMAIN = '.wm.mall.cn';
  var a = keys + "=" + value;
  if (typeof expire != 'undefined') {
    var date = new Date();
    expire = parseInt(expire, 10);
    date.setTime(date.getTime() + expire * 1000);
    a += "; expires=" + date.toGMTString();
  }
  a += ";path=" + path;
  // a += ";domain="+C_DOMAIN;
  document.cookie = a;
};

//删除浏览器cookie
function remove_cookie(key) {
  if (!key) {
    return false;
  } else {
    var keys = 'KT-' + key;
    document.cookie = keys + "=;expires=" + new Date(0).toGMTString();
  }
};

//获取浏览器cookie
function get_cookie(key) {
  // console.log(key)
  if (!key) {
    return false;
  } else {
    var keys = 'KT-' + key;
    // console.log(keys)
    var reg = new RegExp("(^| )" + keys + "=([^;]*)(;|\x24)");
    var result = reg.exec(document.cookie);
    // console.log(result,document.cookie)
    if (result) {
      return result[2] || '';
    }
    return '';
  }
};

